//MATH cos and sin functions:

double cos(double theta){
	return 1 - (theta*theta)/2 + (theta*theta*theta*theta)/24 
	- (theta*theta*theta*theta*theta*theta)/720 ;
	//+ (theta*theta*theta*theta*theta*theta*theta*theta)/40320;
}

double sin(double theta){
	return theta - (theta*theta*theta)/6 + (theta*theta*theta*theta*theta)/120; 
	//- (theta*theta*theta*theta*theta*theta*theta)/5040 ;
	//+ (theta*theta*theta*theta*theta*theta*theta*theta*theta)/362880;
}
   
