void draw_line(int x0, int y0, int x1, int y1, short int line_colour)
{
	int temp = 0;
	
	bool is_steep = abs(y1 - y0) > abs(x1 - x0);
	if(is_steep == true)
	{
		temp = x0;
		x0 = y0;
		y0 = temp;		
		
		temp = x1;
		x1 = y1;
		y1 = temp;
	}
	if(x0 > x1)
	{
		temp = x0;
		x0 = x1;
		x1 = temp;
		
		temp = y0;
		y0 = y1;
		y1 = temp;
	}
	
	int deltax = x1 - x0;
	int deltay = abs(y1 - y0);
	int error = -(deltax/2);
	int y = y0;
	int ystep = 0;
	
	if (y0 < y1)
		ystep = 1;
	else
		ystep = -1;
		
	for(int x = x0; x < x1 + 1; x++)
	{
		
		if(is_steep)
			plot_pixel(y, x, line_colour);
		else
			plot_pixel(x, y, line_colour);
		
		error = error + deltay;
		
		if (error > 0)
		{
			y = y + ystep;
			error = error - deltax;
		}

	}

}

void draw_aim(int x0, int y0, double theta, short int line_colour){
	
	double thetaR = (3.1415927*theta)/180;
	int vy = sin(thetaR)*7;
	int vx = cos(thetaR)*7;
	
	plot_pixel(x0, y0, line_colour);
	
	y0 = y0+vy;
	x0 = x0+vx;
	plot_pixel(x0, y0, line_colour);
	
	y0 = y0+vy;
	x0 = x0+vx;
	plot_pixel(x0, y0, line_colour);
	
	y0 = y0+vy;
	x0 = x0+vx;
	plot_pixel(x0, y0, line_colour);
	
	y0 = y0+vy;
	x0 = x0+vx;
	plot_pixel(x0, y0, line_colour);
	
	
}

void wait_for_vsync()
{
	volatile int * pixel_ctrl_ptr = (int *) 0xff203030; // base address
	int status;
	*pixel_ctrl_ptr = 1; // start the synchronization process
	// - write 1 into front buffer address register
	
	status = *(pixel_ctrl_ptr + 3); // read the status register
	while ((status & 0x01) != 0) // polling loop waiting for S bit to go to 0
	{
		status = *(pixel_ctrl_ptr + 3);
	}
	
}

